        const response = await fetch(fetchAdress, {
            'method': 'POST',
            headers : {
            'Content-Type': 'application/json'
            },
            body : JSON.stringify(resetMassage)
        })

    } 
    post()
}




/**
 * The ResetButton is used to reset a scene
 */
